import React from 'react';

const Navigation = ({onRouteChange}) => {
	return (
		<nav className="flex justify-end">
			<p onClick={onRouteChange}className="f3 link dim black underline pa3 pointer">Sign Out</p>
		</nav>
	);
}

export default Navigation;
